import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom"; // Use useNavigate instead of useHistory
import Header from "../components/layout/header";
import Footer from "../components/layout/footer";
import "../styles/jobrequests.css";

const JobRequests = () => {
  const [requests, setRequests] = useState([]);
  const [userLocation, setUserLocation] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate(); // useNavigate hook for navigating to job details page

  // Get the user's current location using Geolocation API
  useEffect(() => {
    if (!navigator.geolocation) {
      alert("Geolocation is not supported by your browser.");
      setLoading(false);
      return;
    }

    navigator.geolocation.getCurrentPosition(
      (position) => {
        const { latitude, longitude } = position.coords;
        setUserLocation({ latitude, longitude });
      },
      (error) => {
        alert("Failed to get location. Please enable location services.");
        setLoading(false);
      }
    );
  }, []);

  // Fetch job requests when user location is available
  useEffect(() => {
    if (userLocation) {
      const storedJobDetails = JSON.parse(localStorage.getItem("jobDetails")) || [];

      // Filter job requests based on proximity to user location
      const filteredRequests = storedJobDetails.filter((job) => {
        const distance = calculateDistance(userLocation, job.coordinates);
        return distance <= 20; // Only show jobs within 20 km
      });

      setRequests(filteredRequests);
      setLoading(false);
    }
  }, [userLocation]);

  // Function to calculate distance between two points (Haversine formula)
  const calculateDistance = (loc1, loc2) => {
    const R = 6371; // Radius of the Earth in km
    const dLat = toRadians(loc2.latitude - loc1.latitude);
    const dLng = toRadians(loc2.longitude - loc1.longitude);
    const a =
      Math.sin(dLat / 2) * Math.sin(dLat / 2) +
      Math.cos(toRadians(loc1.latitude)) *
        Math.cos(toRadians(loc2.latitude)) *
        Math.sin(dLng / 2) *
        Math.sin(dLng / 2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    const distance = R * c; // Distance in km
    return distance;
  };

  // Convert degrees to radians
  const toRadians = (degree) => (degree * Math.PI) / 180;

  const handleDecision = (id, action) => {
    if (action === "accept") {
      const acceptedJob = requests.find((req) => req.id === id);
      setRequests((prev) => prev.filter((req) => req.id !== id)); // Remove from requests

      // Save accepted job to local storage
      localStorage.setItem("acceptedJob", JSON.stringify(acceptedJob));
      navigate("/workerdashboard"); // Redirect to Worker Dashboard
    } else {
      setRequests((prev) => prev.filter((req) => req.id !== id)); // Reject job
    }
  };

  return (
    <>
      <Header />
      <div className="job-requests-page">
        <h1>Job Requests</h1>
        {loading ? (
          <p style={{ textAlign: "center", color: "#555" }}>Loading job requests...</p>
        ) : requests.length === 0 ? (
          <p style={{ textAlign: "center", color: "#555" }}>No pending requests within 20 km.</p>
        ) : (
          requests.map((req) => (
            <div className="job-request-card" key={req.id}>
              <h2>{req.service}</h2>
              <p>Job Type: {req.description}</p>
              <p>Location: {req.location}</p>
              <p>Date: {req.date}</p>
              <p>Time: {req.time}</p>
              <div className="job-request-actions">
                <button
                  className="accept-btn"
                  onClick={() => handleDecision(req.id, "accept")}
                >
                  Accept
                </button>
                <button
                  className="reject-btn"
                  onClick={() => handleDecision(req.id, "reject")}
                >
                  Reject
                </button>
                <button
                  className="view-details-btn"
                  onClick={() => navigate(`/job-details?id=${req.id}`)}
                >
                  View Details
                </button>
              </div>
            </div>
          ))
        )}
      </div>
      <Footer />
    </>
  );
};

export default JobRequests;
